import React, { Component } from 'react';
import logo from './logo.svg';
import axios from 'axios';
import './App.css';
import sai from './sai';
import { HashRouter as Router, Route, Link } from 'react-router-dom';

class Form extends Component {

  constructor(props){
    super(props);

    this.state = {
      stories:''
    }

    axios.get('http://10.90.90.102:3002/').then(res=>{

      this.setState({"stories":res.data});
      console.log(res.data)
    })

  }
  render() {
    return (
      <div className="App">
        <p>{this.state.stories}</p>
        <div><Router><Link to = "/link">Link</Link></Router></div>
       <Route path="/link" component={sai}></Route>

      </div>
    );
  }
}

export default Form;
